import React from 'react';
import {Link} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <nav className="nav-wrapper grey">
        <div className="container">
          <Link to="/" className="brand-logo">Nihar</Link>
        </div>
      </nav>
    </div>
  );
}

export default App;
